use reqwest;
use serde::{Deserialize, Serialize};

#[derive(Debug, Serialize, Deserialize)]
pub struct SpeechResponse {
    pub audio: Vec<u8>,
}

#[derive(Debug, Serialize, Deserialize)]
pub struct Voice {
    pub language: String,
    pub gender: String,
}

#[derive(Debug, Serialize, Deserialize)]
pub struct ElevenLabs {
    pub api_key: String,
}

impl ElevenLabs {
    pub fn new(api_key: String) -> Self {
        ElevenLabs { api_key }
    }

    pub async fn generate_speech(&self, text: &str, voice: Voice) -> Result<SpeechResponse, reqwest::Error> {
        let url = format!("https://api.elevenlabs.io/v1/speech?text={}&voice={}&key={}", text, voice.language, self.api_key);
        let response = reqwest::get(url).await?;
        let speech_response: SpeechResponse = response.json().await?;
        Ok(speech_response)
    }
}
